import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

// --- IMPORT COMPONENTS ---
import Sidebar from './components/Sidebar';
import StudentSignUp from './components/StudentSignUp';
import StudentSignIn from './components/StudentSignIn';

// --- IMPORT PAGES ---
import Dashboard from './pages/Dashboard';
import Events from './pages/Events'; // Make sure you created src/pages/Events.jsx from the previous step

// --- PLACEHOLDER COMPONENTS ---
// (Use these until you build the real MyTickets, Profile, and Settings pages)
const MyTickets = () => <div style={{ padding: '40px' }}><h1>üéüÔ∏è My Tickets Page</h1><p>Your booked events will appear here.</p></div>;
const Profile = () => <div style={{ padding: '40px' }}><h1>üë§ Profile Page</h1><p>Manage your account details.</p></div>;
const Settings = () => <div style={{ padding: '40px' }}><h1>‚öôÔ∏è Settings Page</h1><p>App preferences.</p></div>;

const App = () => {
  // 1. User State (Null = Not Logged In)
  const [user, setUser] = useState(null); 
  
  // 2. Theme State
  const [theme, setTheme] = useState('light'); // 'light' or 'dark'

  // 3. Mock Data for Events (Shared across Dashboard and Events page)
  const [events] = useState([
    { id: 1, title: 'React Workshop', date: '12 Apr ¬∑ 09:00 AM', location: 'Hall A', category: 'Tech', image: 'https://images.unsplash.com/photo-1633356122544-f134324a6cee?w=400' },
    { id: 2, title: 'Design Thinking', date: '15 Apr ¬∑ 11:00 AM', location: 'Lab 2', category: 'Design', image: 'https://images.unsplash.com/photo-1561070791-2526d30994b5?w=400' },
    { id: 3, title: 'Career Fair', date: '20 Apr ¬∑ 10:00 AM', location: 'Auditorium', category: 'Career', image: 'https://images.unsplash.com/photo-1544531586-fde5298cdd40?w=400' },
    { id: 4, title: 'AI Seminar', date: '22 Apr ¬∑ 02:00 PM', location: 'Online', category: 'Tech', image: 'https://images.unsplash.com/photo-1620712943543-bcc4688e7485?w=400' },
    { id: 5, title: 'Robotics 101', date: '25 Apr ¬∑ 09:00 AM', location: 'Mech Lab', category: 'Tech', image: 'https://images.unsplash.com/photo-1581091226825-a6a2a5aee158?w=400' },
    { id: 6, title: 'Resume Building', date: '28 Apr ¬∑ 04:00 PM', location: 'Classroom 4', category: 'Career', image: 'https://images.unsplash.com/photo-1586281380349-632531db7ed4?w=400' },
  ]);

  // Handle Login
  const handleLogin = (userData) => {
    setUser({ 
      ...userData, 
      profileImage: 'https://images.unsplash.com/photo-1494790108377-be9c29b29330?w=100' // Mock Image
    });
  };

  // Handle Logout
  const handleLogout = () => {
    setUser(null);
  };

  return (
    <Router>
      <div style={{ 
        display: 'flex', 
        backgroundColor: theme === 'dark' ? '#0f172a' : '#f8fafc', 
        minHeight: '100vh',
        fontFamily: "'Inter', sans-serif"
      }}>
        
        {/* --- SIDEBAR (Only visible if logged in) --- */}
        {user && (
          <Sidebar 
            user={user} 
            theme={theme} 
            onLogout={handleLogout} 
          />
        )}

        {/* --- MAIN CONTENT AREA --- */}
        <div style={{ 
          flex: 1, 
          // 56px matches the collapsed Sidebar width to prevent overlap
          marginLeft: user ? '56px' : '0', 
          transition: 'margin-left 0.3s ease',
          width: '100%'
        }}>
          
          <Routes>
            {/* --- PUBLIC ROUTES --- */}
            <Route path="/signup" element={<StudentSignUp onLogin={handleLogin} />} />
            <Route path="/signin" element={<StudentSignIn onLogin={handleLogin} />} />

            {/* --- PROTECTED ROUTES (Redirect to Signin if no user) --- */}
            
            {/* Dashboard */}
            <Route 
              path="/" 
              element={ user ? (
                <Dashboard 
                  user={user} 
                  events={events} 
                  theme={theme} 
                  regCount={3} 
                  unreadCount={2} 
                  onReadNotifications={() => {}} 
                />
              ) : (
                <Navigate to="/signin" />
              )} 
            />
            
            {/* Events Page (The one we just fixed) */}
            <Route 
              path="/events" 
              element={ user ? (
                <Events 
                  user={user} 
                  events={events} 
                  theme={theme} 
                /> 
              ) : (
                <Navigate to="/signin" />
              )} 
            />
            
            {/* Other Pages */}
            <Route path="/my-events" element={user ? <MyTickets /> : <Navigate to="/signin" />} />
            <Route path="/profile" element={user ? <Profile /> : <Navigate to="/signin" />} />
            <Route path="/settings" element={user ? <Settings /> : <Navigate to="/signin" />} />

          </Routes>
        </div>

      </div>
    </Router>
  );
};

export default App;
